export default function Navbar() {
    return(
        <nav className='nav'>
            <a href="/" className="site-title">Site Name</a>
            <ul>
                <li>
                    <a href="/blogs">Blogs</a>
                </li>
                <li>
                    <a href="/about">About</a>
                </li>
            </ul>
        </nav>
    )
}

function CustomLink({href,children, ...props}) {
 return(
    <li>
        <a href={href}>{children}</a>
    </li>
 )
}
